import 'jest-canvas-mock';
import { fireEvent, render, screen, waitFor } from '@testing-library/react';
import PhotoView from '.';

const dummyBase64Img = "data:image/png;base64,"

let imgSrc = dummyBase64Img;

function updateImgSrc(newSrc) {
    imgSrc = newSrc
}

describe('Test Photo View', () => {
    beforeEach(() => {
        imgSrc = dummyBase64Img;
    });

    test('render properly', () => {
        render(
            <PhotoView 
                imageSrc={imgSrc}
                setImageSrc={updateImgSrc}
            />
        );

        expect(screen.getByText(/Download/i)).toBeInTheDocument();
        expect(screen.getByText(/Retake Image/i)).toBeInTheDocument();
    });
});